window.ctcl={submitContactForm:function(t){var e=document.getElementById("recaptcha-token"),c=document.getElementById("contact-form");e&&(e.value=t),c&&c.submit()},handleAccordionClick:function(t){t.currentTarget.classList.toggle("open")}},document.addEventListener("DOMContentLoaded",function(){Array.from(document.querySelectorAll(".accordion-section-header")).forEach(function(t){t.addEventListener("click",window.ctcl.handleAccordionClick,{capture:!0})})});